import logo from "./logo.svg";
import "./assets/css/App.css";
import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/home/Home";
import Jobvacancy from "./pages/job-vacancy/Jobvacancy";
import Detail from "./pages/job-vacancy/Detail";
import Login from "./pages/login-register/Login";
import LayoutLanding from "./layout/LayoutLanding";
import LayoutDashboard from "./layout/LayoutDashboard";

function App() {
    return (
        <BrowserRouter>
            <div className="font-poppins text-dark">
                <Routes>
                    <Route
                        path="/"
                        element={
                            <LayoutLanding>
                                <Home />
                            </LayoutLanding>
                        }
                    />
                    <Route
                        path="/job-vacancy"
                        element={
                            <LayoutLanding>
                                <Jobvacancy />
                            </LayoutLanding>
                        }
                    />
                    <Route
                        path="/job-vacancy/1"
                        element={
                            <LayoutLanding>
                                <Detail />
                            </LayoutLanding>
                        }
                    />

                    <Route path="/dashboard" element={<LayoutDashboard>tes</LayoutDashboard>} />
                </Routes>
            </div>
        </BrowserRouter>
    );
}

export default App;
